Defendant Jessica N Duran in court with attorney Joel Alan Mogren.  Daniel J. Gabler appeared for the State of Wisconsin.  Deputy Court Clerk ssm.

AS TO COUNT 1:  Defendant changes her plea to NO CONTEST.  AS TO COUNT 2:  Defendant changes her plea to GUILTY.  AS TO BOTH COUNTS:  Defendant examined as to her plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived her rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

AS TO COUNT 1:  Defendant sentenced to serve 90 DAYS in the House of Correction.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 12 MONTHS.

AS TO COUNT 2:  Defendant sentenced to serve 30 DAYS in the House of Correction.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 12 MONTHS.

Sentences are CONSECUTIVE to each other.

CONDITIONS AS TO BOTH COUNTS:  
*  AODA assessment/treatment deemed appropriate;
*  Obtain a mental health assessment/treatment deemed appropriate;
*  Successfully complete a course in anger management or batterer's intervention;
*  No contact with Geraldine D. unless requested by her and authorized by agent;
*  Court will waive any costs and surcharges that can be waived.  Any costs and surcharges that can not be waived are to be paid during term or probation or, if not paid, convert to a civil judgment.

CONDITION AS TO COUNT 1 ONLY:
*  Perform 20 hours of community service.
